import React from 'react';

function Close() {
  return (
    <svg width='24' height='24' viewBox='0 0 24 24' xmlns='http://www.w3.org/2000/svg'>
      <line x1='3' y1='21.2286' x2='20.5858' y2='3.64286' strokeWidth='2' strokeLinecap='round' />
      <line x1='20.5863' y1='21' x2='3.00056' y2='3.41421' strokeWidth='2' strokeLinecap='round' />
    </svg>
  );
}

export default Close;
